import React, {useRef} from "react";
import { Form, Button } from "react-bootstrap";
import "./RegisterForm.css";

const RegisterForm = () => {
  const enteredEmail = useRef()
  const enteredUserName = useRef()
  const enteredFirsName = useRef()
  const enteredLastName = useRef()
  const enteredPassword = useRef()
  const enteredConfirmPassword = useRef()

  const data = {}
  async function postData(url = 'http://localhost:5000/signup', data = {}) {
    // Default options are marked with *
    const response = await fetch(url, {
      method: 'POST', // *GET, POST, PUT, DELETE, etc.
      mode: 'cors', // no-cors, *cors, same-origin
      cache: 'no-cache', // *default, no-cache, reload, force-cache, only-if-cached
      credentials: 'same-origin', // include, *same-origin, omit
      headers: {
        'Content-Type': 'application/json'
        // 'Content-Type': 'application/x-www-form-urlencoded',
      },
      redirect: 'follow', // manual, *follow, error
      referrerPolicy: 'no-referrer', // no-referrer, *no-referrer-when-downgrade, origin, origin-when-cross-origin, same-origin, strict-origin, strict-origin-when-cross-origin, unsafe-url
      body: JSON.stringify(data) // body data type must match "Content-Type" header
    });
    return response.json(); // parses JSON response into native JavaScript objects
  }
  
  postData('https://example.com/answer', { answer: 42 })
    .then(data => {
      console.log(data); // JSON data parsed by `data.json()` call
    });
  return (
    <div className="registerContainer">
      <div className="boxRegister">
        <div className="registerForm">
        <h3>Register</h3>
        <Form onSubmit={registerFormHandler}>
            <Form.Text className="text-muted">
              We'll never share your data with anyone else.
            </Form.Text>
            <br/>
          <Form.Group className="mb-3" controlId="formEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" ref={enteredEmail} placeholder="Enter email" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formUserName">
            <Form.Label>User Name</Form.Label>
            <Form.Control type="text"  ref={enteredUserName} placeholder="User name" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control type="text"  ref={enteredFirsName} placeholder="First name" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control type="text" ref={enteredLastName} placeholder="Last name" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" ref={enteredPassword} placeholder="Password" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="formConfirmPassword">
            <Form.Label>Confirm Password</Form.Label>
            <Form.Control type="password" ref={enteredConfirmPassword} placeholder="Confirm Password" />
          </Form.Group>
          <Button variant="primary"  style={{'float':'right'}} type="submit">
            Register
          </Button>
        </Form>
        </div>
      </div>
    </div>
  );
};

export default RegisterForm;
